import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Button } from 'react-native';
import { connect } from 'react-redux';
import { getAllDogs } from '../store/allDogs';

import AllDogs from '../component/allDogs';

class HomeScreen extends React.Component {
  constructor() {
    super();
    this.handleAllDogs = this.handleAllDogs.bind(this);
  }
  handleAllDogs() {
    this.props.getAllDogs();
  }

  render() {
    return (
      <View>
        {/* <View style={styles.dashboardWrapper}> */}
        {/* <Text style={styles.userText}>Hey User</Text> */}
        <AllDogs navigation={this.props.navigation} />
        <Button title="GET DOGS" onPress={() => this.handleAllDogs()} />
        {/* </View> */}
      </View>
    );
  }
}

const mapDispatchToProps = dispatch => {
  return {
    getAllDogs: () => {
      dispatch(getAllDogs());
    },
  };
};

const Home = connect(null, mapDispatchToProps)(HomeScreen);
export default Home;

const styles = StyleSheet.create({
  container: {
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'yellow',
  },
  dashboardWrapper: {
    textAlign: 'center',
  },
  userText: {
    fontSize: 30,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  logoutButton: {
    backgroundColor: 'blue',
    paddingVertical: 10,
    width: 100,
    alignSelf: 'center',
  },
  logoutButtonText: {
    color: '#fff',
    textAlign: 'center',
    fontWeight: 'bold',
  },
});
